import React from 'react';
import GetPortfolio from "./components/GetPortfolio";


const Main = ({ sessionId }) => {
    return (
        <div>
            {sessionId === null && <Redirect to="/login" />}
            <GetPortfolio sessionId={sessionId} />
        </div>
    );
    
}

export default Main;
